  \"horicon-national-wildlife-refuge-narrative-report-may-june-july-august-1945\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Horicon National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1945.
  The report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, raptors, and fish- is also covered. The Refuge development and
  maintenance section discusses physical development, plantings, collections and receipts,
  prescribed fires, and wildfires. Resource management is outlined; topics include
  grazing, haying, fur harvesting, and timber removal. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  and violations. N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
